import React from 'react';




class Token extends React.Component{


    constructor(props){
        super(props);

        this.state = {
            email : "",
            password : ""
        }

    }

    render(){
        return(
            <>


              <input
                type = "text"
                name = "email"
                value = {this.value.email}
              />

            </>

        )
    }


}



export default Token;
